1249.source:
function addAttributeConnectionsAsLinks() {
    this.target.withAllSubmorphsDo(function(ea) { 
    if (ea.attributeConnections) {
        ea.attributeConnections.forEach(function(con) {
            if (this.data.morphs[con.targetObj.id])
            this.data.connections.push({
                source: this.data.morphs[ea.id], target: this.data.morphs[con.targetObj.id], weight: 0.5})
        }, this)
    }
}, this)
}

1253.source:
function addMorphsAndSubmorphLinks() {
    this.data = {morphs: {}, connections: []}
    var self = this;
    var createTree = function(m) {
        var node = {name: m.name || m.constructor.name, id: m.id}
        node.ownProperties = Properties.own(m).length
        node.ownFunctions = Functions.own(m).length
        self.data.morphs[node.id] = node
        if (m.submorphs) {
            node.children = m.submorphs.collect(function(ea) { 
                var childNode = createTree(ea)
                childNode.parent = node
                return childNode
            })
        }
        return node
    }
    this.data.root = createTree(this.target)


}

1257.source:
function addDerivationHistoryOfMorph(m, depth) {
    var source = m
    if (!source.derivationIds) return;
    var ids = source.derivationIds.clone()

    while(id = ids.pop()) {
        var target;
        $world.withAllSubmorphsDo(function(ea) {
            if(ea.id == id) { 
                target = ea
            }
        })
        if (target) {
            this.data.connections.push({
                source: this.data.morphs[source.id], 
                target: this.data.morphs[target.id], 
                depth: depth,
                weight: 0.5})
        }
    }

}

1261.source:
function addDerivationHistoryOfMorphHierrachy(morph, depth, max) {
    this.addDerivationHistoryOfMorph(morph, max - depth);
    if (depth > 0) {
        morph.submorphs.each(function(ea) {
            this.addDerivationHistoryOfMorphHierrachy(ea, depth - 1, max)
        }.bind(this))
    }
}

1269.source:
function getMorphById(id) {
    var result
    $world.withAllSubmorphsDo(function(ea) {
        if (ea.id == id) {result = ea}
    })
    return result
}

